import React from 'react'
import Inicio from './Plantilla';

function Eventos() {
  return (
    <div>
      <Inicio>
        <div>Evento 1</div>
        <div>Evento 2</div>
        <div>Evento 3</div>
        <div>Evento 4</div>
        <div>Evento 5</div>
      </Inicio>
    </div>
  )
}

export default Eventos
